// App.js
import React from "react";
import Navbar from "./components/Navbar";
import Card from "./components/Card";

function App() {
  return (
    <div className="App">
      <header>
        <Navbar />
      </header>
      <main>
        <Card />
      </main>
    </div>
  );
}

export default App;
